function getIndex(arr: Array<string>) {
  const now = new Date()
  const start = new Date(2022, 0, 0)
  const diff = Number(now) - Number(start)
  let day = Math.floor(diff / (1000 * 60 * 60 * 24))
  while (day > arr.length) {
    day -= arr.length
  }

  return day
}

